	public void render(Entity entity, float f, float f1, float f2, float f3,
			float f4, float f5) {
		super.render(entity, f, f1, f2, f3, f4, f5);
		setRotationAngles(f, f1, f2, f3, f4, f5);
		Body.render(f5);
	}

	private void setRotation(PixelmonModelRenderer model, float x, float y,
			float z) {
		model.rotateAngleX = x;
		model.rotateAngleY = y;
		model.rotateAngleZ = z;
	}

	public void setRotationAngles(float f, float f1, float f2, float f3,
			float f4, float f5) {
		BackRightArm.rotateAngleZ = MathHelper.cos(f2 * .1F + 1F) * .25F;
		BackLeftArm.rotateAngleZ = -MathHelper.cos(f2 * .1F + 1F) * .25F;

		BackRightArm.rotateAngleX = MathHelper.cos(f2 * .1F + 1F) * .25F;
		BackLeftArm.rotateAngleX = MathHelper.cos(f2 * .1F + 1F) * .25F;
	}

